      let response = await fetch('/api/notes/')

      let data = await response.json()
      console.log('Data',data)
      setNotes(data)

   }
  return (
    <div className='notes'>
      <div className='notes-header'>
        <h2>&#9782</h2>
      {notes.map((note,index) => (

      <h3 key={index}>{note.body}</h3>

      ))}
</div>
    </div>
  )
}

export default NotesListPage
